import { Link } from "react-router-dom";

export default function EventsPage() {
  const EVENTS = [
    {
      id: "e1",
      title: "event 1",
    },
    {
      id: "e2",
      title: "event 2",
    },
  ];

  return (
    <>
      {EVENTS.map((event) => (
        <ul>
          <li key={event.id}>
            <Link to={event.id}>{event.title}</Link>
          </li>
        </ul>
      ))}
    </>
  );
}
